module.exports = "<div class=\"easy-fees-intro\">\r\n  <div class=\"intro-header\">\r\n    <h2 class=\"header-text\">Easy Fees</h2>\r\n    <mdl-button mdl-shadow=\"6\" mdl-ripple routerLink=\"../setup\">\r\n      Get Started\r\n    </mdl-button>\r\n  </div>\r\n  <div class=\"fee-policy\">\r\n    <p>Intro text including feedback from ECI regarding Fee Policy</p>\r\n  </div>\r\n  <div class=\"info-cards\">\r\n    <div class=\"info-card\" mdl-shadow=\"6\">\r\n      <div class=\"card-media\">\r\n        <img src=\"/assets/img/easy-fees/intro.svg\" alt=\"\">\r\n      </div>\r\n      <div class=\"card-body\">\r\n        <p class=\"card-title\">\r\n          Introduction\r\n        </p>\r\n        <p class=\"card-text\">\r\n          Collect and manage payments using Easy Fees. Automatically debit\r\n          customer accounts or track cash payments.\r\n        </p>\r\n      </div>\r\n      <div class=\"card-actions\">\r\n        <mdl-button mdl-ripple>\r\n          <mdl-icon>play_circle_outline</mdl-icon>\r\n          Play Video\r\n        </mdl-button>\r\n      </div>\r\n    </div>\r\n    <div class=\"info-card\" mdl-shadow=\"6\">\r\n      <div class=\"card-media\">\r\n        <img src=\"/assets/img/easy-fees/step-1.svg\" alt=\"\">\r\n      </div>\r\n      <div class=\"card-body\">\r\n        <p class=\"card-title\">\r\n          Step 1\r\n        </p>\r\n        <p class=\"card-subtitle\">\r\n          Upload documentation\r\n        </p>\r\n        <p class=\"card-text\">\r\n          To set you up as a merchant we will need some documentation for AML\r\n          purposes.\r\n        </p>\r\n      </div>\r\n      <div class=\"card-actions\">\r\n        <mdl-button mdl-ripple>\r\n          <mdl-icon>play_circle_outline</mdl-icon>\r\n          Play Video\r\n        </mdl-button>\r\n      </div>\r\n    </div>\r\n    <div class=\"info-card\" mdl-shadow=\"6\">\r\n      <div class=\"card-media\">\r\n        <img src=\"/assets/img/easy-fees/step-2.svg\" alt=\"\">\r\n      </div>\r\n      <div class=\"card-body\">\r\n        <p class=\"card-title\">\r\n          Step 2\r\n        </p>\r\n        <p class=\"card-subtitle\">\r\n          Collect E-Mandates\r\n        </p>\r\n        <p class=\"card-text\">\r\n          In order to collect fees from parents by direct debit each\r\n          parent will need to return an electronic mandate.\r\n        </p>\r\n      </div>\r\n      <div class=\"card-actions\">\r\n        <mdl-button mdl-ripple>\r\n          <mdl-icon>play_circle_outline</mdl-icon>\r\n          Play Video\r\n        </mdl-button>\r\n      </div>\r\n    </div>\r\n    <div class=\"info-card\" mdl-shadow=\"6\">\r\n      <div class=\"card-media\">\r\n        <img src=\"/assets/img/easy-fees/step-3.svg\" alt=\"\">\r\n      </div>\r\n      <div class=\"card-body\">\r\n        <p class=\"card-title\">\r\n          Step 3\r\n        </p>\r\n        <p class=\"card-subtitle\">\r\n          Collect Payments!\r\n        </p>\r\n        <p class=\"card-text\">\r\n          Once the e-mandates have been returned you can start to collect\r\n          payments by direct debit.\r\n        </p>\r\n      </div>\r\n      <div class=\"card-actions\">\r\n        <mdl-button mdl-ripple>\r\n          <mdl-icon>play_circle_outline</mdl-icon>\r\n          Play Video\r\n        </mdl-button>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n"

